import React, { Fragment } from 'react';
import Die from './die'


function Row({rowRolls }) {
    console.log(`printing row with ${rowRolls.length} columns`)

    let diceInRow = []
    let id = 0
    for (let [index, value] of rowRolls.entries()) {
        console.log(`sending die index ${index+1} letter ${value}` )
        id=index+1
        diceInRow.push(<Die key={id.toString()} id={id.toString()} roll={value}/>)
    }

    console.log(`diceInRow `, diceInRow)
    return (<td>diceInRow</td>)
}

export default Row
